if mibBuilder.loadTexts: atFilev2CopyBegin.setDescription("A read on this object can return several possible values, depending on the current status of the system and the various file operation objects: idle There is no file operation in progress and all required objects have been set correctly. Setting a '1' to this object will begin the file copy. Error codes: [1-7] A copy operation cannot be started until these errors are resolved. See below for key. [action]ing x [--> y] A file operation is currently in progress. You cannot start another operation while the object is returning this value. [action] x [--> y] success The last copy, move or delete operation was successfully completed. [action] x [--> y] failure: [err] The last copy, move or delete operation failed, with the error message attached. Common failures include lack of space on the destination file system, incorrect source file names or communication errors with remote services. Upon reading a success or failure message, the message will be cleared and the next read will result in either an 'idle' message or an 'Error codes' message if not all required objects have been correctly set. If a read returns 'idle', a new file operation can be started. Error codes for file copy: 1 - atFilev2SourceDevice has not been set 2 - atFilev2SourceFilename has not been set 3 - atFilev2DestinationDevice has not been set 4 - atFilev2DestinationFilename has not been set 5 - atFilev2SourceDevice and atFilev2DestinationDevice are both set to TFTP 6 - the combination of source device, stackID and filename is the same as the destination device, stackID and filename (i.e. it is not valid to copy a file onto itself. 7 - TFTP IP address has not been set and TFTP has been set for one of the devices Note that if the above requirements are met and the operation would result in a system file being modified, then an SNMP set to this object will be disallowed. For valid operations, immediately upon executing the SNMP set operation on this object, the file copy will begin and will continue on the device until either it has completed, or a failure occurs. For large files, operations can take several minutes to complete. Subsequent reads of the object will return one of the messages shown above, to track the progress of the copy operation.")
