if mibBuilder.loadTexts: atFilev2BeginDirOperation.setDescription("A read of this object will always return 'idle' (1). All applicable objects above must have been set correctly in order to commence an operation. The following values may be set to perform the operations described: createDir (2) : This will create a new directory with a name equating to atFilev2DestDirName, on the device indicated by atFilev2DirStackID, and the file system indicated by atFilev2DirFileSystem, with the path to the directory being indicated by atFilev2DirPath. The given path structure must already exist. renameDir (3) : This will rename an existing directory with a name equating to atFilev2SourceDirName, to a name equating to atFilev2DestDirName on the device indicated by atFilev2DirStackID, and the file system indicated by atFilev2DirFileSystem, with the path to the directory being indicated by atFilev2DirPath. The given path structure and source directory must already exist, and a rename operation cannot change the path where the directory currently resides. deleteEmptyDir (4) : This will delete an existing directory with a name equating to atFilev2SourceDirName, on the device indicated by atFilev2DirStackID, and the file system indicated by atFilev2DirFileSystem, with the path to the directory being indicated by atFilev2DirPath. However, the operation will fail if the specified directory is not empty. Only sub-directories within the specified file system can be deleted. deleteForceDir (5) : This will delete an existing directory with a name equating to atFilev2SourceDirName, on the device indicated by atFilev2DirStackID, and the file system indicated by atFilev2DirFileSystem, with the path to the directory being indicated by atFilev2DirPath. The operation will also automatically delete any contents within the specified directory. Only sub- directories within the specified file system can be deleted.")
